// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import './App.css'; // Add your styling as needed
import Home from './Home';
import FullStackDevelopment from './FullStackDevelopment';
import DataScience from './DataScience';
import CyberSecurity from './CyberSecurity ';
import Career from './Career';


function App() {
  return (
    <Router>
      <div style={{backgroundColor:'green', }}>
        {/* Navigation Bar */}
        <nav style={{padding:'30px', marginTop:'30px', backgroundColor:'white'}}>
              <span style={{padding:'10px',}}><Link to="/" className='Hoving'>All</Link></span>
              <span style={{padding:'10px'}}><Link to="/full-Stack-development" className='Hoving'>Full Stack Development</Link></span>
              <span style={{padding:'10px'}}><Link to="/data-science" className='Hoving'>Data Science</Link></span>
              <span style={{padding:'10px'}}><Link to="/cyber-security" className='Hoving'>Cyber Security</Link></span>
              <span style={{padding:'10px'}}><Link to="/career" className='Hoving' >Career</Link></span>
            
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/full-stack-development" element={<FullStackDevelopment />} />
          <Route path="/data-science" element={<DataScience />} />
          <Route path="/cyber-security" element={<CyberSecurity />} />
          <Route path="/career" element={<Career />} />
          {/* Default route */}
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;

